import React from 'react'
import { Card, CardHeader, CardContent, Typography  } from '@mui/material';
import StyledComponent from './style'

const Details = ({title}) => {

  return (
    <div>
        <StyledComponent>
            <Card>
                <CardHeader title={title} />
                <CardContent>
                    <Typography variant="h5">$50</Typography>
                    {/* <Doughnut data="DATA" /> */}
                </CardContent>
            </Card>
        </StyledComponent>

    </div>
  )
}

export default Details;
